import React, { useState } from "react";
import Navbar from "../navbar/nav";

const Visualizer = () => {
  // Declare state variable array
  const [array, setArray] = useState([]);

  // Declare Handlers
  const resetArray = () => {
    function getIntFromTo(min, max) {
      return Math.floor(Math.random() * (max - min + 1) + min);
    }

    setArray((arr) => {
      for (let i = 0; i < 200; i++) {
        arr.push(getIntFromTo(10, 1000));
        return arr;
      }
    });
  };

  return (
    <div>
      <Navbar resetHandler={resetArray} />
    </div>
  );
};

export default Visualizer;
